INSERT INTO `tblcomentario` (`id_comentario`, `fecha_hora`, `id_usuario`, `texto_comentario`, `tipo_comentario`, `id_objeto`, `estado`) VALUES
(1, '2013-12-02 12:55:55', 2, 'Se gestionaron las actas de paso a calidad y cierre. Se entregaron las facturas estamos a espera que nos realicen el pago', 1, 25, 1),
(2, '2013-12-02 18:35:24', 2, 'se entrego acta de modificación de fechas y de paso a calidad', 1, 14, 1),
(3, '2013-12-02 18:36:29', 2, 'Se entrego acta de DT', 1, 4, 1),
(4, '2013-12-02 18:37:04', 2, 'Se entregaron actas de DT, Calidad y cierre', 1, 12, 1),
(5, '2013-12-03 00:35:19', 2, 'Se entrego acta de DT', 1, 2, 1),
(6, '2013-12-04 02:58:40', 2, 'Se acordó con Iván Martínez que el día de mañana se entregaban los ajustes, el desarrollo del ldap y que el jueves 5 definíamos sí se podía adelantar la fecha de entrega del portal virtual para antes del 20. Además debemos dar una explicación porque en el servidor de desarrollo no funciona la aplicación.', 1, 20, 1),
(7, '2013-12-04 03:02:18', 2, 'Se entregó el acta de DT y quedaron en entregarla firmada por parte de banco el día de mañana 4 de diciembre de 2013', 1, 2, 1),
(8, '2013-12-04 13:08:39', 2, 'Esta facturado en GEF@, se solicitó a diana paola angel reenvio del Vo. Bo. de la fecha de aprobación', 1, 11, 1),
(9, '2013-12-04 13:10:16', 2, 'ACTA DE MODIFICACIÓN DE FECHAS, no lo han instalado,... se quedo en certificación', 1, 13, 1),
(10, '2013-12-04 14:36:47', 2, 'Se entrego acta modificación y de paso a calidad, quedaron en entregarlas en horas de las mañana', 1, 13, 1),
(11, '2013-12-04 14:40:10', 2, 'Se iba a cerrar con compromiso, que no se pudo por la nueva norma de GLG, entonces se hizo acta de modificación para instalación el otro año', 1, 7, 1),
(12, '2013-12-04 14:40:35', 2, 'Se instalara el otro año', 1, 7, 1),
(13, '2013-12-04 14:42:16', 2, 'Ya se entregaron las actas de cierre, están en proceso de facturacion', 1, 5, 1),
(14, '2013-12-04 14:43:39', 2, 'Ya esta Facturado a paso a calidad y estamos a espera que el banco instale para cobrar produccion', 1, 3, 1),
(15, '2013-12-04 14:45:00', 2, 'Se paso el acta de cierre, y esperamos las actas firmadas el día de hoy.', 1, 11, 1),
(16, '2013-12-05 16:48:02', 2, 'Se hablo con Ivan Martines, y se acordÃ³ que el error del proyecto en desarrollo se validarÃ­a con la ayuda de Humberto Patarroyo, la entrega de los ajustes seria instalada en ambiente de calidad por Angelica Garzon y las pruebas las realizarÃ­a Jenny Urdaneta. Lo reportado de esta revisiÃ³n se debe atender el mismo dÃ­a.', 1, 20, 1),
(17, '2013-12-06 15:28:33', 14, 'Se presentan problemas con la instalación del .BAT (Mueve archivos despues de que el Workload los copia para el envío).Se acuerda con el Banco hacer la instalación en Producción de los componentes de Workload y Broker pero no dejar el proyecto productivo hasta que se entregue la segunda fase (Aun no contratada por el Banco)', 1, 25, 1),
(18, '2013-12-06 20:43:15', 2, 'Se acordó en la reunión de seguimiento los siguientes compromisos:1. Se seguirá trabajando en validar el error de la maquina de desarrollo2. La autenticación del LDAP se hará en portal, por cada ambiente por parte del banco3. La entrega de los portales virtuales se harán el 12 de diciembre de 20134. A partir del día lunes 9 se dará un reporte diario de las pruebas de integración con PIBEE5. Jenny entregara reporte y se entregaran los ajustes el día de hoy.', 1, 20, 1),
(19, '2013-12-06 22:00:05', 25, 'En la mañana no habia acceso a z: repositorio de red, posteriormente Transaccional solo nos habilito 3 maquinas para este acceso y en la actualidad, transaccional solicita que la mesa haga pruebas en maquina Windows antes de subir componentes, se alista maquina CE29528', 1, 27, 1),
(20, '2013-12-09 20:41:01', 25, 'construccion de pantallas hasta el 12 de diciembre', 1, 53, 1),
(21, '2013-12-09 20:42:29', 25, 'El proyecto habia sido dado de baja por GEF@, ya lo habilitaron, construccion hasta el 19 de diciembre, ivan y juan jara lo comienzan a validad con las fuentes actualizadas desde junio 2013', 1, 17, 1),
(22, '2013-12-09 20:52:09', 25, 'la semana del 25/11 al 29/11 nos enseñaron un error el cual les inofrme que era por versión, se indico a la mesa que informaran a transaccional, así mismo, el ajuste de la HX02 referente a lanzar 2 veces la transacción, por contrato e identificación lo asume el banco', 1, 3, 1),
(23, '2013-12-19 16:24:53', 2, 'Instalaciones en producción al día.', 1, 24, 1),
(24, '2014-01-05 19:04:27', 6, 'Como te va con la aplicación??', 2, 2, 1),
(25, '2014-01-13 20:45:31', 2, 'Que en instalación en producción el 7 de MArzo', 1, 7, 1),
(26, '2014-01-14 14:45:10', 2, 'Se facturo calidad, el acta de modificación quedo para febrero', 1, 13, 1),
(27, '2014-01-14 14:47:39', 2, 'Se cobro calidad y esta pendiente por parte de banco definir cronograma para acta de modificacion', 1, 9, 1),
(28, '2014-01-14 14:51:28', 2, 'Solo se ha facturado el 50%, debe tener un acta de modificación de fechas', 1, 7, 1),
(29, '2014-01-14 14:52:41', 2, 'Sale de Calidad el 14 de Febrero y en producción el 12 de Marzo', 1, 7, 1),
(30, '2014-01-14 15:05:29', 2, 'En tramite cobro del 100% (Contrato anterior), ya que el acta de cierre esta con fecha del 28 de Junio de 2013, por lo cual las vigencias de la póliza caducaron y no se ha logrado emitir la ampliación, Jaime Vargas solicito a la mesa aval para extender el proyecto hasta el mes de enero de 2014 con el fin de obtener la ampliación de la poliza y facturar la totalidad del proyecto.', 1, 5, 1),
(31, '2014-01-14 15:10:16', 2, 'Según acta de modificación de fechas, cierre se extiende hasta el 31 de Enero de 2014.', 1, 3, 1),
(32, '2014-01-14 15:12:30', 2, 'Después de validar este proyecto no es de Jefa, tiene su anexo A propio. Pasa a calidad el 28 de enero y se ha facturado solo el 50%', 1, 17, 1),
(33, '2014-01-14 15:18:11', 2, 'Solo se facturo solo DT 50%, por problemas con el paso calidad, porque internamente en banco no encuentran el requerimiento. ', 1, 12, 1),
(34, '2014-01-14 15:24:12', 2, 'Facturado hasta calidad y el cierre esta para el 14 de Febrero', 1, 29, 1),
(35, '2014-01-14 15:27:23', 2, 'cerrado y cobrado', 1, 14, 1),
(36, '2014-01-14 15:28:41', 2, 'Se cobro DT, se entregaron desarrollos y esta pendiente acta de modificación y paso a calidad', 1, 4, 1),
(37, '2014-01-14 15:32:23', 2, 'Se facturo DT se están haciendo pruebas y la fecha de calidad es el 24 de enero', 1, 2, 1),
(38, '2014-01-14 17:07:13', 12, 'El proyecto actualmente se encuentra a la espera de la modificación de las reglas de firewall', 1, 15, 1),
(39, '2014-01-14 17:10:36', 12, 'En estos momentos el tema esta para paso a calidad, pero existe un problema con el requerimiento debido a que en el banco no saben cual es y aun no han dado una respuesta sobre el tema. ', 1, 67, 1),
(40, '2014-01-14 17:12:53', 12, 'En estos momentos el tema esta para paso a calidad, pero existe un problema con el requerimiento debido a que en el banco no saben cual es y aun no han dado una respuesta sobre el tema. ', 1, 12, 1),
(41, '2014-01-19 22:08:49', 12, 'El requerimiento ya fue encontrado y asignado por Alexander Balaguera a Nilsan Rojas, ella se encuentra actualizando la documentación para volver a subir el requerimiento. A mas tardar el día Martes 21 de enero se tendrá respuesta de la fecha para empezar pruebas en Calidad', 1, 12, 1),
(42, '2014-01-19 22:14:25', 12, 'Al igual que el GP9245-2 el requerimiento ya fue encontrado y asignado por Alexander Balaguera a Nilsan Rojas, ella se encuentra actualizando la documentación para volver a subir el requerimiento. A mas tardar el día Martes 21 de enero se tendrá respuesta de la fecha para empezar las pruebas en Calidad', 1, 67, 1),
(43, '2014-01-19 22:29:01', 12, 'Por parte de tecnología se realizo la modificación de las reglas de firewall, al realizar pruebas en Datapower no retorna el response de Fasecolda. Se gestiono para tener un audio con fasecolda el cual estamos a la espera del mencionado audio.', 1, 15, 1),
(44, '2014-01-19 22:34:15', 12, 'El tema ya se encuentra en calidad, no se han realizado pruebas debido a que por parte de banco se debe cargar una tabla con información y porque se debió modificar el set de pruebas. Se espera el día lunes se de inicio a las pruebas', 1, 8, 1),
(45, '2014-01-20 21:28:41', 19, 'Se realizaron pruebas en calidad de PIBEE en las cuales no funciono. Se realizo una conferencia con Mexico en la cual se llego al acuerdo de analizar en que momento se realiza la perdida de datos por parte de la junction.', 1, 20, 1),
(46, '2014-02-21 22:29:51', 19, 'El cliente realizo pruebas en el aplicativo en el cual solo hizo dos correcciones de cambio de titulo', 1, 21, 1),
(47, '2014-02-22 08:47:01', 2, 'Se le hace un ajuste salarial puesto que trabaja con nosotros parcialmente mas o menos un 70% del tiempo.', 2, 11, 1),
(48, '2014-03-09 11:53:21', 2, 'Tema ya esta cerrado', 1, 18, 1),
(49, '2014-03-09 11:55:58', 2, 'Este tema tambien esta cerrado', 1, 25, 1),
(50, '2014-03-09 11:56:16', 2, 'Tema cerrado', 1, 88, 1),
(51, '2014-03-09 12:05:54', 2, 'Durante los meses de Marzo, Abril, Mayo y Junio (2014) se le hará un reajuste de 300mil en su tarjeta de bonos, al finalizar este tiempo de ejecución de su proyecto en Alma viva, se decidirá su permanencia en bono o el paso de este valor al salario base. ', 2, 108, 1),
(52, '2014-03-11 22:15:31', 2, 'El usuario JEIFFER EUSTACIO OSPINA CASTILLO se unio a la herramienta.', 2, 109, 1),
